import React from "react";
import { Link } from "react-router-dom";

const Navbar = () => {
    return (
        <nav class="ui secondary vertical pointing menu">
            <Link class="item">New releases</Link>
            <Link class="active item">Artist</Link>
            <Link class="item">Track</Link>
            <Link class="item">Album</Link>
            <Link class="item">Playlist</Link>
            <Link class="item">Favorites</Link>
        </nav>
    );
};

export default Navbar;
